--1013
SELECT DISTINCT  
	D.* ,
	PIF.*,
	LN90.*
FROM 
	@DATA D
	INNER JOIN CDW..FS10_DL_LON FS10
		ON FS10.BF_SSN = D.BF_SSN
		AND FS10.LF_FED_AWD + RIGHT('000' + CAST(FS10.LN_FED_AWD_SEQ AS VARCHAR(10)),3) = D.AWARD_ID
	LEFT JOIN CDW..CS_TRANSFERPIF PIF
		ON PIF.BF_SSN = D.BF_SSN
	LEFT JOIN
	(
		SELECT DISTINCT
				LN90.BF_SSN,
				LN90.LN_SEQ,
				LN90.LD_FAT_EFF
			FROM
				CDW..LN90_FIN_ATY LN90
			WHERE
				LN90.LC_STA_LON90 = 'A'
				AND COALESCE(rtrim(LN90.LC_FAT_REV_REA),'') = ''
				AND LN90.PC_FAT_TYP = '04'
				AND LN90.PC_FAT_SUB_TYP = '96'
				AND LN90.LD_FAT_EFF >= '11/09/2020'
	) LN90
		ON LN90.BF_SSN = FS10.BF_SSN
		AND LN90.LN_SEQ = FS10.LN_SEQ
